description:
This set of books is basically a diary of Warren Ellis talking about his work, his future projects, and a wide variety of his thoughts.  There are a lot of pages of just text and not much artwork, but what artwork there is was done by none other than the great Tim Vigil.  These are all excellent quality scans about 1000 pixels wide.  There are no advertising pages.

